import React from "react";
import './HomePage.css';
import {useNavigate} from 'react-router-dom';
import SignupPage from "./SignupPage";
function HomePage() {
    const navigate = useNavigate();

    handleLoginClick = () =>{
        navigate('/login');
    }
    handleSigninClick = () =>{
        navigate(SignupPage);
    }
    return (
        <body>
            <div className="header">
                <img src="/Assets/logo.png" alt="Logo" />
            </div>
            <div className="contentHome">
                <h2>Welcome to CodeQuest</h2>
                <p>A friendly place to learn and grow.Get started with a coding challenge, check out our courses, or just hang out and chat.</p>
                <button className="signin btnhome" onClick={handleSigninClick}>Sign In</button>
                <p className="checking">Already have an account?</p>
                <button className="login btnhome" onClick={handleLoginClick}>Log In</button>
            </div>

        </body>
    );
}

export default HomePage;
